	function makeAdjency() {
		initialiseMatrix(nameVector.length);
		selectedIDCount = 0;
		
		for(t = 0; t < gameData.length; t++) {
			addGame(t);
		}
	}
	
	function spliceVector(vector) {
		var newVect = new Array(selectedTagCount);
		var counter = selectedTagCount - 1;
		
		for(q = selectedTags.length - 1; q > -1 && counter > -1; q--) {
			if(selectedTags[q] == 1) {
				newVect[counter] = vector[q];
				counter--;
			}
		}
		
		return newVect;
	}
	
	function addGame(gameIndex) {
		var vector = gameData[gameIndex][4];
		var newVect;
		
		if(vector.length > selectedTagCount) {
			newVect = spliceVector(vector);
		} else {
			newVect = vector;
		}
		var length = newVect.length;
		
		var count_add = 0;		
		var index_add = 0;
		for(i = 0; i < length && count_add < 2; i++) {
			if(vector[i] != 0) {
				index_add = i;
				count_add++					
			}
		}
		if(count_add > 1) {
			// It has more than one tag which then need to be inter-related
			for(row = 0; row < length; row++) {
				if(newVect[row] == 1) {
					for(col = 0; col < length; col++) {
						if(row != col) {
							
							matrix[row][col] // And error is being thrown here
								+= newVect[col]; 
						}		
					}
				}
			}
		} else {
			// It has only one tag.
			matrix[index_add][index_add] += 1;
		}
		
		selectedIDCount++;
	}
	
	function removeTag(tagIndex) {
		selectedTags[tagIndex] = 0;
		selectedTagCount--;
		nameVector.splice(tagIndex, 1);
		
		initialiseMatrix(selectedTagCount);
		selectedIDCount = 0;
		
		for(g = gameData.length - 1; g > -1; g--) {
			var vect = spliceVector(gameData[g][4]);
			if(vect[tagIndex] == 1) {
				addGame(g);
			} else {
				gameData.splice(g, 1);
			}
		}
	}
	
	
	function removeZeroes() {
		// This funciton will remove all rows/columns in the matrix which are all zeroes
		for(k = matrix.length - 1; k >= 0; k--) {
			var empty = true;
			for(j = 0; j < matrix.length; j++) {
				if(matrix[k][j] != 0) {
					empty = false;		
					break;
				}
			}
			if(empty) {
				selectedTags[k] = 0;
				selectedTagCount--;// This just removes the game. It doesn't actually force all games in filter to have some relation to the selected tag to filter on			
				nameVector.splice(k, 1);
				matrix.splice(k,1);
				matrix = d3.transpose(matrix);
				matrix.splice(k,1);
			}
		}
			
	}
	
	
