	function dragstarted(d) {
	  d3.event.sourceEvent.stopPropagation();
	  d3.select(this).classed("dragging", true);
	}
	
	
	function draggedLeft(d) {
	  var selection = d3.select(this);
	  var mouseY = d3.event.y;
	  if(mouseY <= leftSliderLimit && mouseY >= -leftSliderLimit) {
		  selection.attr("points", (leftX - sliderWidth) + "," + (10 + mouseY) + " " + (leftX - sliderWidth) + "," + (mouseY - 10) + " " + leftX + "," +  mouseY);
		  selection.attr("height", mouseY);
	  } else if(mouseY > 0){
		  selection.attr("points", (leftX - sliderWidth) + "," + (10 + leftSliderLimit-1) + " " + (leftX - sliderWidth) + "," + (leftSliderLimit - 10-1) + " " + leftX + "," +  (leftSliderLimit-1));
		  selection.attr("height", leftSliderLimit-1);
	  } else {
		  selection.attr("points", (leftX - sliderWidth) + "," + (10 - leftSliderLimit) + " " + (leftX - sliderWidth) + "," + (-leftSliderLimit - 10+1) + " " + leftX + "," +  (-leftSliderLimit+1));
		  selection.attr("height", -leftSliderLimit+1);
	  }
	}
	
	
	function draggedRight(d) {
	  var selection = d3.select(this);
	  var mouseY = d3.event.y;
	  if(mouseY <= rightSliderLimit && mouseY >= -rightSliderLimit) {
		  selection.attr("points", (rightX + sliderWidth) + "," + (10 + mouseY) + " " + (rightX + sliderWidth) + "," + (mouseY - 10) + " " + rightX + "," +  mouseY);
		  selection.attr("height", mouseY);
	  } else if(mouseY > 0){
		  selection.attr("points", (rightX + sliderWidth) + "," + (10 + rightSliderLimit) + " " + (rightX + sliderWidth) + "," + (rightSliderLimit - 10) + " " + rightX + "," +  rightSliderLimit);
		  selection.attr("height", rightSliderLimit-1);
	  } else {
		  selection.attr("points", (rightX + sliderWidth) + "," + (10 - rightSliderLimit) + " " + (rightX + sliderWidth) + "," + (-rightSliderLimit - 10) + " " + rightX + "," +  -rightSliderLimit);
		  selection.attr("height", -rightSliderLimit+1);
	  }
	}
	
	
	function dragendedLeft(d) {
	  d3.select(this).classed("dragging", false);	  
	  filterByOwners();
	  updateData();
	}
	
	
	function dragendedRight(d) {
	  d3.select(this).classed("dragging", false);
	  filterByScore();
	  updateData();
	}
	
	
	function mousemove() {
		return function() {
			var mouse = d3.mouse(this);
			var mouseX = mouse[0] - (width/2);
			var mouseY = mouse[1] - (height/2);
			tooltip.attr("transform", "translate(" + mouseX + "," + mouseY + ")");
		}
	}
	
	function filterByOwners() {
		var values = new Array(2);
		d3.selectAll(".sliderLeft").each(function(d, i) { 
			values[i] = d3.select(this).attr("height"); 
		});
		if(values[0] > values[1]) {
			highestL = values[1] - ownerY;
			lowestL = values[0] - ownerY;
		} else {
			highestL = values[0] - ownerY;
			lowestL = values[1] - ownerY;
		}
		var reverse = d3.scale.linear()
                         .range([maxL,minL])
                         .domain([ownerY,ownerY+ownerH]);
		
		initialiseMatrix(selectedTagCount);
		
		selectedIDCount = 0;
		
		for(l = gameData.length - 1; l > -1; l--) {
			if(gameData[l][3] < reverse(lowestL - barY) || gameData[l][3] > reverse(highestL - barY)) {
				gameData.splice(l, 1);
			} else {
				addGame(l);
			}
		}
	}
	
	
	function filterByScore() {
		var values = new Array(2);
		d3.selectAll(".sliderRight").each(function(d, i) { 
			values[i] = d3.select(this).attr("height"); 
		});
		if(values[0] > values[1]) {
			highestL = values[1] - scoreY;
			lowestL = values[0] - scoreY;
		} else {
			highestL = values[0] - scoreY;
			lowestL = values[1] - scoreY;
		}
		var reverse = d3.scale.linear()
                         .range([maxR,minR])
                         .domain([scoreY,scoreY+scoreH]);
		
		
		initialiseMatrix(selectedTagCount);
		
		selectedIDCount = 0;
		
		for(l = gameData.length - 1; l > -1; l--) {
			if(gameData[l][2] < reverse(lowestL - barY) || gameData[l][2] > reverse(highestL - barY)) {
				gameData.splice(l, 1);
			} else {
				addGame(l);
			}
		}
	}
	
	
	function colorMap(index) {
		var rem = index % 8;
		switch(rem) {
			case 0:
				return "#b35806";
			case 1:
				return "#e08214";
			case 2:
				return "#fdb863";
			case 3:
				return "#fee0b6";
			case 4:
				return "#d8daeb";
			case 5:
				return "#b2abd2";
			case 6:
				return "#8073ac";
			case 7:
				return "#542788";
		}
	}
	
	
	function createChord() {
		// Chord diagram code based off of https://bl.ocks.org/mbostock/4062006
		
		var chordAll = svg.append("g").attr("class","chordAll");
		var chord = d3.layout.chord()
	    .padding(.01)
	    .sortSubgroups(d3.descending)
	    .matrix(matrix);
		
		
		chordAll.append("g").selectAll("path")
	    .data(chord.groups)
		.enter().append("path")
	    .style("fill", function(d) { return colorMap(d.index); })
	    .style("stroke", function(d) { return colorMap(d.index); })
	    .attr("d", d3.svg.arc().innerRadius(innerRadius).outerRadius(outerRadius))
	    .on("mouseover", fade(.01))
	    .on("mouseout", fade(unselectedOpacity))
	    .on("click", function(d) {
			if(d.value > 5) {
				tagsInFilter += nameVector[d.index] + ", ";
				svg.select(".selection").text(tagsInFilter);
				removeTag(d.index);
			} else {
				console.log("This action would result in an empty matrix.")
			}
			updateData();
		});
	
		var ticks = chordAll.append("g").selectAll("g")
			.data(chord.groups)
			.enter().append("g").selectAll("g")
			.data(groupTicks)
			.enter().append("g")
					.attr("transform", function(d) {
							return "rotate(" + (d.angle * 180 / Math.PI - 90) + ")"
							+ "translate(" + outerRadius + ",0)";
					});
	
		ticks.append("line")
			.attr("x1", 1)
			.attr("y1", 0)
			.attr("x2", 5)
			.attr("y2", 0)
			.style("stroke", "#000");
	
		ticks.append("text")
			.attr("x", 8)
			.attr("dy", ".35em")
			.attr("transform", function(d) { return d.angle > Math.PI ? "rotate(180)translate(-16)" : null; })
			.style("text-anchor", function(d) { return d.angle > Math.PI ? "end" : null; })
			.text(function(d) { return d.label; });
	
		chordAll.append("g")
			.attr("class", "chord")
			.selectAll("path")
				.data(chord.chords)
			.enter().append("path")
				.attr("d", d3.svg.chord().radius(innerRadius))
				.style("fill", function(d) { return colorMap(d.target.index); })
				.style("opacity", unselectedOpacity);
				
		createTooltip(); // Needs to be called after the chord to ensure it's kept at the front
	}
		
	// Returns an array of tick angles and labels, given a group.
	function groupTicks(d) {
	  var k = (d.endAngle - d.startAngle) / d.value;
	  return d3.range(0, d.value, 1000).map(function(v, i) {
	    return {
	      angle: k * (d.value / 2) + d.startAngle,
		   label: nameVector[d.index]
	    };
	  });
	}
	
	// Returns an event handler for fading a given chord group.
	function fade(opacity) {
		var chordAll = svg.select(".chordAll");
	  return function(g, i) {
		 // Get count of games with tag
		 var counter = 0;
		 for(c = 0; c < gameData.length; c++) {
			var newVect = spliceVector(gameData[c][4]);
			if(newVect[i] == 1) {
				counter++
			}
		 }
		  
		  if(opacity != unselectedOpacity) {
			  tooltip.style("visibility", "visible");
			  tooltip.select(".text1").text("Tag: " + nameVector[i]);
			  if(counter > 0) {
				tooltip.select(".text2").text("Number of games: " + counter);
			  } else {
				tooltip.select(".text2").text("Only ");
			  }
			  
		  } else {
			  tooltip.style("visibility", "hidden");
		  }
	  
	    chordAll.selectAll(".chord path")
	        .filter(function(d) { return d.source.index != i && d.target.index != i; })
	      .transition()
	        .style("opacity", opacity);
	  };
	}
	
	
	function updateChord() {
		svg.select(".chordAll").remove();
		svg.select(".tooltip").remove();
		createChord();
	}
	
	
	function createHeat() {
		
		var numbersR = gameData.map(function(x){return x[2];});		// Required to apply max/min to index 1 of the array

		maxR = d3.max(numbersR);
		minR = d3.min(numbersR);		

		svg.select(".score")
			.append("g")
			.attr("class", "scoreData");
			
		var numbersL = gameData.map(function(x){return x[3];});		// Required to apply max/min to index 1 of the array

		maxL = d3.max(numbersL);
		minL = d3.min(numbersL);
		
		svg.select(".owners")
			.append("g")
			.attr("class", "ownerData");	
		
		
		var ownerGroup = svg.select(".ownerData");
		var scoreGroup = svg.select(".scoreData");
		
		gameData.forEach(function(d, i) {
			if(d[2] > -1 && d[3] > 0) {
				scoreGroup.append("rect")
				.attr("width", scoreW - 2)
				.attr("height", scoreH / 100)
				.attr("x", scoreX + 1)
				.attr("y", function() {
					var y_score = (scoreH - ((scoreH * (d[2] - minR)) / (maxR-minR)) + (scoreY + minR/maxR));
					if(y_score > barY + 2 - (scoreH / 100)) {
						return barY + 2 - (scoreH / 100);
					} else if(isNaN(y_score)) {
						var y_score = maxR;
						maxR = maxR + 1;
						minR = minR - 1;
						
						var scaling = d3.scale.linear()
							.domain([maxR,minR])
							.range([scoreY,scoreY+scoreH]);
						
						return scaling(y_score);
					} else {
						return y_score;
					}
						// Scales the Y value in respect to both the maximum and minimum values of the data to use as much space as possible.
				})
				.attr("fill", "blue")
				.attr("opacity", function() {
						return 1 / 75;
				});
				
				ownerGroup.append("rect")
				.attr("width", ownerW - 2)
				.attr("height", ownerH / 100)
				.attr("x", ownerX + 1)
				.attr("y", function() {
					var y_own = (ownerH - ((ownerH * (d[3] - minL)) / (maxL-minL)) + (ownerY + minL/maxL)); 
					if(y_own > barY - (ownerH / 100)) {
						return barY - (ownerH / 100);
					} else if(isNaN(y_own)) {
						var returning = maxL;
						maxL = maxL + 10;
						minL = minL - 10;
						
						var scaling = d3.scale.linear()
							.domain([maxL,minL])
							.range([ownerY,ownerY+ownerH]);
						
						
						return scaling(returning);
					} else {
						return y_own;
					}
						// Scales the Y value in respect to both the maximum and minimum values of the data to use as much space as possible.
				})
				.attr("fill", "blue")
				.attr("opacity", function() {
						return 1 / 15;
				});
				
				
			}
		});
		
		var axisScale = d3.scale.linear()
                         .domain([maxR,minR])
                         .range([scoreY,scoreY+scoreH]);

		var rAxis = d3.svg.axis()
                  .scale(axisScale)
                  .orient("right");
                  
      scoreGroup.append("g").call(rAxis).attr("transform", "translate(" + (scoreX + scoreW) + ",0)");
      scoreGroup.select(".domain").attr("visibility", "hidden");
	  
	  
	  
	  
	    var axisScale = d3.scale.linear()
                         .domain([maxL,minL])
                         .range([ownerY,ownerY+ownerH]);

		var lAxis = d3.svg.axis()
                  .scale(axisScale)
                  .orient("left");
                  
      ownerGroup.append("g").call(lAxis).attr("transform", "translate(" + ownerX + ",0)");
      ownerGroup.select(".domain").attr("visibility", "hidden");
	  
	}
	
	function updateHeat() {
		svg.select(".scoreData").remove();
		svg.select(".ownerData").remove();
		createHeat();
	}	
	
	function updateData() {
		updateHeat();
		updateSliders();
		removeZeroes();
		updateChord();
		updateList();
		svg.select(".selectionTitle").text("Number of Tags: " + selectedTagCount + "     " + ", Number of Games: " + gameData.length)
	}
	
	function updateSliders() {
		svg.selectAll(".slider").remove();
		createSliders();		
	}
	
	
	function createSliders() {
		rightSliderLimit = 50*scoreH/100;
		createSlidersRight(scoreX + scoreW - 10, rightSliderLimit-1);
		createSlidersRight(scoreX + scoreW - 10, -rightSliderLimit+1);
		highestR = -rightSliderLimit;
		lowestR = rightSliderLimit;
		
		leftSliderLimit = 50*ownerH/100;
		createSlidersLeft(ownerX + 10, leftSliderLimit-1);	
		createSlidersLeft(ownerX + 10, -leftSliderLimit+1);	
		highestL = -leftSliderLimit;
		lowestL = leftSliderLimit;
	}
	
	function createSlidersLeft(a, b) {
		var x1 = (a - sliderWidth);
		var y1 = b + 10;
		var x2 = (a - sliderWidth);
		var y2 = b - 10;
		var x3 = a;
		var y3 = b;
		leftX = x3;
		
		var slider = svg.append("g").attr("class", "slider")
			.append("polygon")
			.attr("class", "sliderLeft")
	      .attr("points", "" + x1 + "," + y1 + " " + x2 + "," + y2 + " " + x3 + "," + y3)
		  .attr("fill", "black")
		  .attr("stroke", "white")
		  .attr("height", b)
	      .call(dragLeft);	
	}
	
	
	function createSlidersRight(a, b) {
		var x1 = (a + sliderWidth);
		var y1 = b + 10;
		var x2 = (a + sliderWidth);
		var y2 = b - 10;
		var x3 = a;
		var y3 = b;
		rightX = x3;
		
		
		var slider = svg.append("g").attr("class", "slider")
			.append("polygon")
			.attr("class", "sliderRight")
	      .attr("points", "" + x1 + "," + y1 + " " + x2 + "," + y2 + " " + x3 + "," + y3)
		  .attr("fill", "black")
		  .attr("stroke", "white")
		  .attr("height", b)
	      .call(dragRight);	
	}
	
	
	function createBox() {
		var width = 202;
		
		scoreW = width;
		scoreH = 802;
		scoreX = outerRadius + 100;
		scoreY = -400;
		
		ownerW = width;
		ownerH = 802;
		ownerX = -1 * (outerRadius + width + 100);
		ownerY = -400;
		
		
		svg.append("g")
			.attr("class", "owners")
			.append("rect")
				.attr("width", ownerW)
				.attr("height", ownerH)
				.attr("x", ownerX)
				.attr("y", ownerY)
				.attr("stroke-width", "2")
				.attr("stroke", "black")
				.attr("fill", "none");
		svg.append("g")
			.attr("class", "score")
			.append("rect")
				.attr("width", scoreW)
				.attr("height", scoreH)
				.attr("x", scoreX)
				.attr("y", scoreY)
				.attr("stroke-width", "2")
				.attr("stroke", "black")
				.attr("fill", "none");
			

		createHeat();
		createSliders();
	}
	
	
	function initialiseMatrix(size) {
			
		var newMatrix = new Array(size);
		for(i = 0; i < size; i++) {
			newMatrix[i] = new Array(size);
		}		
		
		for(i = 0; i < newMatrix.length; i++) {
			for(j = 0; j < newMatrix[0].length; j++) {
				newMatrix[i][j] = 0;			
			}
		}
	
		matrix = newMatrix;
	}
	
